'use strict';
let GetTemporarySessionCommand = require('./GetTemporarySessionCommand.js');
let UniqueStringBuilder = require('./UniqueStringBuilder.js');
//@@DocBrief("The command for getting temporary trading session by SSO token")
class GetTemporarySessionBySsoTokenCommand extends GetTemporarySessionCommand {
    ssoToken;
    ssoTokenProvider;
    createTransportMessage() {
        return this.messageFactory.createGetTemporaryTradingSessionBySsoTokenRequestMessage(this.ssoToken, this.login, this.applicationName, this.agent, this.terminal, this.requestNumberGenerator, UniqueStringBuilder.getString(), this.ssoTokenProvider, this.configFlags);
    }
}
module.exports = GetTemporarySessionBySsoTokenCommand
